  false,\n\t\"url\": null,\n\t\"notes\": \"This proposed biomonitoring plan is for
  Seedskadee National Wildlife Refuge in Sweetwater county, Wyoming.  Biomonitoring
  is needed for the refuge especially due to trona mining wastewater and oil and gas
  pipelines directly upstream and downstream of the refuge contaminating the water.
  \ Contaminant monitoring is needed on the refuge as it poses a hazard to migratory
  birds.  Biomonitoring can provide information useful to the acquisition process,
  and can provide baseline information on the quality of the refuge.\",\n\t\"license_title\":
